def find_most_frequent(arr):
    counts = {}
    for num in arr:
        if num not in counts:
            counts[num] += 1
        else:
            counts[num] = 1
    frequent_nums = []
    for (num, count) in counts.items():
        if count >= 3:
            frequent_nums.append((num, count))
    frequent_nums.sort(key=lambda x: x[1], reverse=True)
    return [num for (num, count) in frequent_nums]

